import React from 'react';
import { Filter, X } from 'lucide-react';

/**
 * FilterBox - Bộ lọc nâng cao
 * 
 * Props:
 * - filters: Object chứa các filter values
 * - onFilterChange: Callback khi filter thay đổi
 * - onReset: Callback khi reset filters
 * - customers: Array danh sách khách hàng
 */
function FilterBox({ filters, onFilterChange, onReset, customers = [] }) {
  const handleChange = (field, value) => {
    onFilterChange({ ...filters, [field]: value });
  };

  const hasActiveFilters = Object.values(filters).some(v => 
    Array.isArray(v) ? v.length > 0 : v !== ''
  );

  return (
    <div className="bg-white border rounded-lg p-4 space-y-4">
      <div className="flex items-center justify-between">
        <div className="flex items-center gap-2">
          <Filter className="w-5 h-5 text-blue-600" />
          <h3 className="font-semibold">Bộ lọc nâng cao</h3>
        </div>
        {hasActiveFilters && (
          <button
            onClick={onReset}
            className="flex items-center gap-1 text-sm text-red-600 hover:text-red-700"
          >
            <X className="w-4 h-4" />
            Xóa bộ lọc
          </button>
        )}
      </div>

      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-4">
        {/* Lọc theo khách hàng */}
        <div>
          <label className="block text-sm font-medium mb-1">Khách hàng</label>
          <select
            multiple
            value={filters.customerIds || []}
            onChange={(e) => {
              const selected = Array.from(e.target.selectedOptions, option => option.value);
              handleChange('customerIds', selected);
            }}
            className="w-full px-3 py-2 border rounded-lg text-sm"
            size="3"
          >
            {customers.map(c => (
              <option key={c.id} value={c.id}>
                {c.code || c.ma_khach_hang} - {c.name || c.ten_khach_hang}
              </option>
            ))}
          </select>
          <p className="text-xs text-gray-500 mt-1">Giữ Ctrl để chọn nhiều</p>
        </div>

        {/* Lọc theo số tiền */}
        <div>
          <label className="block text-sm font-medium mb-1">Số tiền (đ)</label>
          <div className="space-y-2">
            <input
              type="number"
              placeholder="Từ..."
              value={filters.minAmount || ''}
              onChange={(e) => handleChange('minAmount', e.target.value)}
              className="w-full px-3 py-2 border rounded-lg text-sm"
            />
            <input
              type="number"
              placeholder="Đến..."
              value={filters.maxAmount || ''}
              onChange={(e) => handleChange('maxAmount', e.target.value)}
              className="w-full px-3 py-2 border rounded-lg text-sm"
            />
          </div>
        </div>

        {/* Lọc theo ngày đặt */}
        <div>
          <label className="block text-sm font-medium mb-1">Ngày đặt</label>
          <div className="space-y-2">
            <input
              type="date"
              value={filters.dateFrom || ''}
              onChange={(e) => handleChange('dateFrom', e.target.value)}
              className="w-full px-3 py-2 border rounded-lg text-sm"
            />
            <input
              type="date"
              value={filters.dateTo || ''}
              onChange={(e) => handleChange('dateTo', e.target.value)}
              className="w-full px-3 py-2 border rounded-lg text-sm"
            />
          </div>
        </div>

        {/* Lọc theo ngày giao */}
        <div>
          <label className="block text-sm font-medium mb-1">Ngày giao dự kiến</label>
          <div className="space-y-2">
            <input
              type="date"
              value={filters.deliveryDateFrom || ''}
              onChange={(e) => handleChange('deliveryDateFrom', e.target.value)}
              className="w-full px-3 py-2 border rounded-lg text-sm"
            />
            <input
              type="date"
              value={filters.deliveryDateTo || ''}
              onChange={(e) => handleChange('deliveryDateTo', e.target.value)}
              className="w-full px-3 py-2 border rounded-lg text-sm"
            />
          </div>
        </div>
      </div>
    </div>
  );
}

export default FilterBox;
